import { Container } from "react-bootstrap";

const Home = () => {
    return (
        <Container className="mt-4 text-center">
            <h1 className="mb-3">Chào mừng đến với Mạng Xã Hội Cựu Sinh Viên</h1>
            <p className="lead">
                Kết nối lại với bạn bè, chia sẻ kỷ niệm, và cập nhật thông tin mới nhất từ cộng đồng cựu sinh viên.
            </p>
            <img 
                src="/images/alumni_welcome.png" 
                alt="Welcome Alumni" 
                className="img-fluid mt-4"
                style={{ maxHeight: "300px" }}
            />
        </Container>
    );
}

export default Home;
